    // Operand is a list of of non-negative integers.
    // Operator list has at least one operator, and operand list has at least two operands.
    public static long DoAlgebra(List<string> op, List<long> operand) {
        long result = operand[0];
        for (int i = 0; i < op.Count - 1; i++) {
            if (op[i] == "+") {
                result += operand[i + 1];
            } else if (op[i] == "-") {
                result -= operand[i + 1];
            } else if (op[i] == "*") {
                result *= operand[i + 1];
            } else if (op[i] == "//") {
                result /= operand[i + 1];
            } else if (op[i] == "**") {
                result = (long)Math.Pow(operand[i + 1], operand[i + 2]);
            }
        }
        return result;

