    // >>> Histogram(("a b b a"))
    // (new Dictionary<string,long>(){{"a", 2L}, {"b", 2L}})
    // >>> Histogram(("a b c a b"))
    // (new Dictionary<string,long>(){{"a", 2L}, {"b", 2L}})
