    // (new Dictionary<string,long>(){{"b", 4L}})
    // >>> Histogram((""))
    // (new Dictionary<string,long>())
    public static Dictionary<string,long> Histogram(string test) {
        Dictionary<string,long> histogram = new Dictionary<string,long>();
        string[] words = test.Split(' ');
        foreach (string word in words) {
            foreach (char letter in word) {
                if (histogram.ContainsKey(letter)) {
                    histogram[letter] += 1;
                } else {
                    histogram.Add(letter, 1);
                }
            }
        }
        return histogram;

