    // >>> ChangeBase((8L), (2L))
    // ("1000")
    // >>> ChangeBase((7L), (2L))
    // ("111")
    public static string ChangeBase(long x, long numBase) {
        if (numBase < 2 || numBase > 10) {
            throw new Exception("Invalid base");
        }
        if (x < 0) {
            throw new Exception("Negative number");
        }
        if (x == 0) {
            return "0";
        }
        string str = "";
        while (x > 0) {
            str = (x % numBase).ToString() + str;
            x /= numBase;
        }
        return str;

