    // (2L)
    public static long Specialfilter(List<long> nums) {
        long count = 0;
        foreach (long num in nums) {
            if (num > 10 && (num % 10) % 2 == 1 && (num / 10) % 2 == 1) {
                count++;
            }
        }
        return count;

